import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../images/logo.png';

function Header() {

    return (
        <nav className="navbar navbar-expand-sm bg-secondary navbar-dark sticky-top">
           <Link className="nav-link" to="/home"><img className="card-img-top" src={logo} style={{width:"35px",height:"35px"}} alt="Card image" /></Link>

           <ul class="nav justify-content-end">
                <li className="nav-item">
                    <Link className="nav-link" to="/">Dashboard</Link>
                </li>                
                {/* <li className="nav-item">
                    <Link className="nav-link" to="/login">Login</Link>
                </li> */}
                
                
                <li className="nav-item">
                    <Link className="nav-link" to="/user/add">Register</Link>
                </li>
                <li className="nav-item">
                    <Link className="nav-link" to="/home">Logout</Link>
                </li>
                
                
            </ul>
        </nav>
    )
}



export default Header;
